import React from "react";
import { TextField } from "@material-ui/core";

const Example9 = (formdata, setFormdata) => {
  return (
    <form>
      <TextField
        label="Name"
        name="name"
        variant="filled"
        type="currency"
        style={{ width: 100 }}
        value={formdata.name}
        onChange={(e) => setFormdata(e)}
      />
      <TextField
        label="Bank AC No"
        name="bank_acno"
        variant="filled"
        type="currency"
        style={{ width: 100 }}
        value={formdata.bank_acno}
        onChange={(e) => setFormdata(e)}
      />
      <button>Submit</button>
    </form>
  );
};

export default Example9;
